class CustomTextEdit(QTextEdit):
    def __init__(self, parent=None):
        super().__init__(parent)
        

    def keyPressEvent(self, event: QKeyEvent):
        if event.key() == Qt.Key_Backspace:
            cursor = self.textCursor()
            if cursor.hasSelection():
                # If there is selected text, delete it normally
                super().keyPressEvent(event)
            else:
                # If there is no selected text, handle Backspace based on cursor position
                cursor = self.textCursor()
                position = cursor.position()
                if position > 0:
                    cursor.movePosition(QTextCursor.Left, QTextCursor.KeepAnchor)
                    cursor.removeSelectedText()
        else:
            super().keyPressEvent(event)

            
class PasswordInputDialog(QDialog):
    def __init__(self, parent=None):
        super().__init__(parent)
        self.setWindowTitle("Enter Password")
        self.password = None

        self.label = QLabel("Enter your password:")
        self.label.setFont(QFont("Arial", 12))  # Increase the font size for the label
        self.password_input = QLineEdit()
        self.password_input.setFont(QFont("Arial", 12))  # Increase the font size for the input field
        self.password_input.setEchoMode(QLineEdit.Password)

        self.ok_button = QPushButton("OK")
        self.ok_button.setFont(QFont("Arial", 12))  # Increase the font size for the button
        self.ok_button.clicked.connect(self.accept_password)

        self.layout = QVBoxLayout()
        self.layout.addWidget(self.label)
        self.layout.addWidget(self.password_input)
        self.layout.addWidget(self.ok_button)
        self.setLayout(self.layout)

    def accept_password(self):
        self.password = self.password_input.text()
        self.accept()


class SecureNotepad(QMainWindow):
    def __init__(self, play_video=True):
        super().__init__()
        self.setWindowTitle("Secure Notepad")
        self.setGeometry(100, 100, 800, 600)
        self.default_font_size = 12
        self.windows = []

        icon_base64 = ""  # Replace with your Base64 icon data
        icon_data = base64.b64decode(icon_base64)
        pixmap = QPixmap()
        pixmap.loadFromData(icon_data)
        self.setWindowIcon(QIcon(pixmap))


        self.text_edit = CustomTextEdit(self)

        self.text_edit.setLineWrapMode(QTextEdit.WidgetWidth)  # Enable word wrap by default


        #Word,line,coloumn count
        self.line_column_label = QLabel("Ln: 1, Col: 1", self)
        self.line_column_label.setAlignment(Qt.AlignLeft)
        self.statusBar().addWidget(self.line_column_label)

        # Create a spacer widget to push widgets to the right
        spacer = QWidget(self)
        spacer.setSizePolicy(QSizePolicy.Expanding, QSizePolicy.Preferred)
        self.statusBar().addPermanentWidget(spacer)

        # Create QLabel for displaying word count
        self.word_count_label = QLabel("Word Count: 0", self)
        self.word_count_label.setAlignment(Qt.AlignRight)
        self.statusBar().addPermanentWidget(self.word_count_label)

        # Connect the textChanged and cursorPositionChanged signals
        self.text_edit.textChanged.connect(self.update_word_count)
        self.text_edit.cursorPositionChanged.connect(self.update_line_column)

        # Initialize line and column
        self.line = 1
        self.column = 1
        # Set the text edit widget as the central widget
        self.setCentralWidget(self.text_edit)

        # Create the menu
        self.create_menu()

        # Store the original content of the text edit for comparison
        self.original_content = self.text_edit.toPlainText()

    def update_word_count(self):
            text = self.text_edit.toPlainText()
            word_count = len(text.split())
            self.word_count_label.setText(f"Word Count: {word_count}")

    def update_line_column(self):
        cursor = self.text_edit.textCursor()
        block = cursor.block()
        self.line = block.blockNumber() + 1
        self.column = cursor.positionInBlock() + 1
        self.line_column_label.setText(f"Ln: {self.line}, Col: {self.column}")

    def closeEvent(self, event):
        if self.text_edit.toPlainText() != self.original_content:
            response = self.show_save_changes_dialog()
            if response == QMessageBox.Save:
                self.save_note()
            elif response == QMessageBox.Cancel:
                event.ignore()
                return
        event.accept()

    def show_save_changes_dialog(self):
        msg_box = QMessageBox()
        msg_box.setWindowTitle("Save Changes")
        msg_box.setText("Do you want to save the changes?")
        msg_box.setStandardButtons(QMessageBox.Save | QMessageBox.Discard | QMessageBox.Cancel)
        msg_box.setDefaultButton(QMessageBox.Save)
        response = msg_box.exec_()
        return response

