class FindDialog(QDialog):
    def __init__(self, parent=None):
        super().__init__(parent)
        self.setWindowTitle("Find")
        self.find_input = QLineEdit(self)
        self.find_next_button = QPushButton("Find Next", self)
        self.find_next_button.clicked.connect(self.find_next)
        self.find_previous_button = QPushButton("Find Previous", self)
        self.find_previous_button.clicked.connect(self.find_previous)
        layout = QVBoxLayout(self)
        layout.addWidget(self.find_input)
        layout.addWidget(self.find_next_button)
        layout.addWidget(self.find_previous_button)

    def find_next(self):
        text_to_find = self.find_input.text()
        parent = self.parent()
        cursor = parent.text_edit.textCursor()
        cursor = parent.text_edit.document().find(text_to_find, cursor)
        if not cursor.isNull():
            parent.text_edit.setTextCursor(cursor)
            self.highlight_text(cursor, text_to_find)

    def find_previous(self):
        text_to_find = self.find_input.text()
        parent = self.parent()
        cursor = parent.text_edit.textCursor()
        cursor = parent.text_edit.document().find(text_to_find, cursor, QTextDocument.FindBackward)
        if not cursor.isNull():
            parent.text_edit.setTextCursor(cursor)
            self.highlight_text(cursor, text_to_find)

    def highlight_text(self, cursor, text):
        extra_selection = QTextEdit.ExtraSelection()
        extra_selection.format.setBackground(Qt.yellow)
        extra_selection.cursor = cursor
        extra_selection.cursor.movePosition(QTextCursor.Right, QTextCursor.KeepAnchor, len(text))
        parent = self.parent()
        parent.text_edit.setExtraSelections([extra_selection])


